INSERT INTO `tips` VALUES (1,'Christmas at the Dome','I love the smell of cinnamon going into the Dome during Christmas time. The cocktails are the best. If you can get a seat definitely break up your Christmas shopping with an afternoon tea.','http://www.thedomeedinburgh.com',1,'2017-11-25 00:55:35','2017-11-25 00:55:35',NULL,'tip/1511571335.jpg',69,21,'51.2245293','-0.1675317'),(2,'Visiting the Grand Mosque','Go early to see the Grand Mosque virtually empty. Be respectful with your clothing. The guides are fab and very knowledgeable.',NULL,1,'2017-11-25 00:59:52','2017-11-25 00:59:52',NULL,'tip/1511571591.jpg',69,39,'35.6566276','139.7316288'),(3,'Posh fish and chips','Go to Cromars in St Andrews for fish and chips and sit in to enjoy a glass of prosecco or craft beer. Poshest fish and chip shop Ive ever been to!','http://cromars.co.uk',1,'2017-11-25 01:11:37','2017-12-04 21:34:53',NULL,'tip/1511572296.jpg',69,23,'25.2649006','55.3087349'),(4,'Best hot chocolate and macaroons in Aberdeen','Go to Almondine in Thistle Street for a posh coffee break where thick rich hot chocolate is served in a silver tea pot. If macaroons arent your thing there are other patisseries that look too good to eat and taste amazing!','http://www.almondine.co.uk',1,'2017-11-25 09:02:06','2017-11-25 09:03:06',NULL,'tip/1511600585.jpg',69,14,'57.2865319','-2.4002647'),(5,'Walk at West Sands','Great beach for a walk with car parking close by, also just a short walk into the town for a coffee and cake!',NULL,1,'2017-11-26 12:30:34','2017-11-26 12:30:34',NULL,'tip/1511699434.jpg',70,23,'55.874893','-4.2954117'),(6,'The Dunavon','If you are looking for great food at a reasonable price, look no further.','http://thedunavon.com',1,'2017-11-26 22:42:48','2017-11-26 22:42:48',NULL,'tip/1511736167.jpg',75,14,'56.3472073','-2.8078707'),(7,'Great bathrooms','Head down to granite bathrooms for great deals',NULL,1,'2017-11-30 16:09:19','2017-11-30 16:09:19',NULL,'tip/default.jpeg',85,14,'24.5336954','54.3959481'),(8,'Coffee and books','Great coffee and banter with excellent book collections head to books and beans.',NULL,1,'2017-11-30 16:11:02','2017-11-30 16:11:02',NULL,'tip/1512058262.jpg',85,14,'24.4125457','54.4739765'),(10,'Boston chocolate shop','Go here for great chocolate',NULL,1,'2017-11-30 16:24:29','2017-11-30 16:51:28','2017-11-30 16:51:28','tip/default.jpeg',69,55,'55.9487372','-3.1953868'),(11,'Boston Chocolates','Best place to buy chocolate in Boston',NULL,1,'2017-11-30 16:38:26','2017-11-30 16:51:16','2017-11-30 16:51:16','tip/default.jpeg',98,55,'45.4302123','-73.8255041'),(12,'Boston Chocolate Shop','Cutest chocolate shop Ive ever seen! ? Unsual flavours and the prettiest patisseries. Highly recommended.','https://www.burdickchocolate.com',1,'2017-11-30 16:40:09','2017-11-30 16:54:48',NULL,'tip/1512060008.jpg',69,55,'40.7494233','-73.9726887'),(13,'Holiday In St Lucia','Its freezing here in North East Scotland just now \n\nSo my mind is on warmer climes!  We holidayed for 2 years in a row to the beautiful island of St Lucia in the Caribbean.\n\nWe went all inclusive both times which was fantastic.  The choice of food is delicious!\n\nOur first holiday was at Coconut Bay Beach Resort and is our favourite.  The staff were sooo friendly and accommodation was really clean, comfortable and beautiful.\n\nTheres absolutely loads to do and its very child friendly.\n\nRight on the beach, its only 5 mins drive from the airport.\n\nOur second trip took us to St James Club which, although very lovely, was not in our opinion as nice as Coconut Bay.  The restaurant staff were not particularly friendly and it was over an hour s drive from the airport.  Food was average and entertainment not as good as Coconut Bay.',NULL,1,'2017-11-30 18:40:18','2017-11-30 18:40:18',NULL,'tip/1512067217.jpg',71,14,'50.2382389','-3.770983'),(14,'Bike hire, sales and servicing','A friendly family run business catering to all you bike related needs. Located in the stunning Royal Deeside town of Ballater, the perfect spot for a memorable outdoor trip.','http://www.cyclehighlands.com',1,'2017-12-01 10:40:20','2017-12-01 14:55:56',NULL,'tip/1512140156.jpg',112,14,'57.3071817','-2.4739288'),(15,'Choose your networks','Business and social networking','https://m.facebook.com/JCIAberdeen/events',1,'2017-12-01 14:32:46','2017-12-01 14:38:47',NULL,'tip/1512138765.jpg',129,14,'55.9471934','-3.1913566'),(16,'When Your Pets Get Poorly','Finding a great vet when youve just moved to a new place.\n\nSadly we lost our beautiful little cat Jess a few weeks after we moved.  She was knocked over by a car, and although I did my best to nurse her back to health, her kidneys failed.  We were lucky to find a caring and compassionate vet in Inverurie.  http://www.donviewvets.co.uk\n\nThe little cat in the picture is Meg.  We rescued her from being left in a bin in Hackney.  My parents brought her home in the train from London to Inverness.  Shes now much loved and has definitely landed on her 4 paws!','http://www.donviewvets.co.uk',1,'2017-12-01 22:05:20','2017-12-01 22:05:20',NULL,'tip/1512165919.jpg',71,14,'1.33106','103.7942513'),(17,'Meadows in Edinburgh','The best time to visit is in Spring when the blossom is out strolling down avenues filled with cherry blossom ? looking at Arthurs Seat and watching a cricket match ?',NULL,1,'2017-12-02 01:17:42','2017-12-02 01:17:42',NULL,'tip/1512177461.jpg',69,21,'57.2040753','-2.1909678'),(18,'Christmas Markets outside of Stockholm Sweden','Get into the spirit by visiting a new Christmas market every week. Enjoy drinking glgg and eating saffron buns (lussekatter)',NULL,1,'2017-12-02 08:28:09','2017-12-02 08:28:09',NULL,'tip/default.jpeg',133,80,'25.2355648','55.2981752'),(19,'Fun with Food!','Here at The Savage Bakery, we specialise in humour, profanity and visual jokes! Adults only - we supply fresh tasty cakes direct to you at any time of the day or night. We have designs and options to suit your personality and budget! Check out our site or scream at us on phone or email with your dark desires...','http://www.thesavagebakery.com',1,'2017-12-02 11:49:44','2017-12-02 11:49:44',NULL,'tip/default.jpeg',148,14,'57.3368518','-2.1823544'),(20,'Best Christmas Trees','Where to buy Christmas Trees that dont shed needles everywhere!','http://scotland.forestry.gov.uk/visit/christmas-trees/centres/tyrebagger',1,'2017-12-02 13:41:12','2017-12-02 13:41:12',NULL,'tip/1512222071.jpg',71,14,'57.147514','-2.1081887'),(21,'St Andrews Cathedral','Get your dose of history at this ancient cathedral in St Andrews which was built in 1158. In 1561 because of the Scottish reformation it was abandoned and left to fall into ruin.',NULL,1,'2017-12-02 21:38:40','2017-12-02 21:38:40',NULL,'tip/1512250719.jpg',69,23,'51.5083364','-0.1569076'),(22,'Aberdeen is great','I think Aberdeen is great',NULL,1,'2017-12-04 10:24:04','2017-12-04 10:24:04',NULL,'tip/1512383043.jpg',162,14,'57.1886597','-3.8309425'),(23,'Pasta Plus','Great restaurant! Small but cosy. Delicious food. Love the owner Francesco.',NULL,1,'2017-12-04 20:17:25','2017-12-04 20:17:25',NULL,'tip/1512418645.jpg',170,14,'56.3395663','-2.7906578'),(24,'Hazelhead Park','The park, maze, cafe, and animals are great to visit! Love this park. So much to do.',NULL,1,'2017-12-04 20:19:32','2017-12-04 20:19:32',NULL,'tip/1512418771.jpg',170,14,'52.0767406','4.275654'),(25,'Hair Salon','One of the things Ive always struggled with when I moved areas is finding a really good hairdresser.  I can highly recommend Hair At The Square, Oldmeldrum, Aberdeenshire.  The owner, Kat, is fantastic!  Youll receive a 5 star service every time.  The salon is beautiful and the stylists are all really friendly.  Prices are competitive.\n\n\n\n\n\n\nhttps://www.google.co.uk/search?q=hair+at+the+square+old+meldrum&ie=UTF-8&oe=UTF-8&hl=en-gb&client=safari','https://www.google.co.uk/search?q=hair+at+the+square+old+meldrum&ie=UTF-8&oe=UTF-8&hl=en-gb&client=safari',2,'2017-12-04 21:24:26','2017-12-04 21:24:26',NULL,'tip/1512422666.jpg',71,14,'40.729049','-73.9897867'),(26,'Amsterdam Train Station','Reminds me of St Pancras Station in London. Good selection of coffee shops and places to get food inside. Make sure you get your tickets before you get on the train, but you can get your tram tickets on board in the middle carriage.\n\nRead more tips for the Netherlands in this blog post.','https://www.relocateguru.io/blog/expats-and-the-city',2,'2017-12-05 02:50:44','2018-03-03 03:50:12',NULL,'tip/default.jpeg',69,34,'57.2034035','-3.2525963'),(27,'Winter in Aberdeen','Although it\'s not cold at the moment. Best to keep a scarf handy!',NULL,2,'2017-12-05 12:16:55','2017-12-06 21:49:08','2017-12-06 21:49:08','tip/default.jpeg',98,14,'1.2815737','103.8614245'),(28,'Grooming','Yeah I am away to groom myself tonight as she is really upset about your jacket today but will go in tomorrow for the old hag to see my favourite things in the train up saves me driving the train','http://www.choochootrain.com',2,'2017-12-06 15:33:33','2017-12-06 21:48:57','2017-12-06 21:48:57','tip/default.jpeg',105,88,'57.2194959','-3.9039234'),(29,'Have breakfast at Tiffanys','You can now have breakfast at Tiffanys!!','http://m.tiffany.com/mobile/locations/eventdetail.aspx?eventid=1063&tfr=1',2,'2017-12-06 21:56:37','2017-12-06 21:56:37',NULL,'tip/default.jpeg',69,30,'45.4792922','-73.5862491'),(30,'All you need a little garden trimmings','Get the greenest grass and make herb',NULL,2,'2017-12-06 22:06:51','2017-12-06 22:14:43','2017-12-06 22:14:43','tip/default.jpeg',184,88,'57.1474648','-2.1034763'),(31,'My favourite spa','The rooftop jacuzzi, hydrotherapy suite, deep relaxation room and luxurious treatments, makes this place my favourite escape or a special treat! ?','https://www.oldcoursehotel.co.uk/spa/kohler-waters-spa',2,'2017-12-06 22:08:40','2017-12-06 22:08:40',NULL,'tip/default.jpeg',69,23,'57.2666775','-5.5254215'),(32,'Amazing waffles','Proper Belgium waffles in St Andrews. This is the tasting menu where you choose 5 glad portions!! It is huge!! Definitely for sharing!','https://www.standrewswafflecompany.co.uk',2,'2017-12-06 22:22:19','2017-12-06 22:22:19',NULL,'tip/1512598938.jpg',69,23,'56.3404081','-2.7960433'),(33,'Super car Circuit','Check out the unofficial super car circuit in Mayfair around Park Lane!',NULL,2,'2017-12-07 09:09:38','2017-12-07 09:09:38',NULL,'tip/default.jpeg',190,32,'55.9506889','-3.1915112'),(34,'Malmaison Aberdeen','They have a great Gin and cocktail selection here.  Lovely soup.','https://theginroomscotland.co.uk',2,'2017-12-08 13:46:03','2017-12-08 20:16:59','2017-12-08 20:16:59','tip/default.jpeg',194,14,'38.6975147','9.2054163'),(35,'MALMAISON ABERDEEN','Confy sofas, really good Gin selection here.  Youll get a really good Negroni.',NULL,2,'2017-12-08 13:57:46','2018-01-17 20:29:07',NULL,'tip/1516220947.jpg',195,14,'57.1497018','-2.1182287'),(36,'My New Favourite Travel Pillow','Get the Trtl Pillow! Its great, so easy to take everywhere with you and its the first time I was able to sleep on a plane!','https://trtltravel.com',2,'2017-12-08 17:32:34','2017-12-08 17:32:34',NULL,'tip/default.jpeg',69,55,'52.0802168','4.3111288'),(37,'Icecream and Sweets','Go to Cones and Candy in Westhill for a huge selection of old fashioned sweets and homemade ice cream','http://www.cones-candy.co.uk',2,'2017-12-08 20:09:20','2017-12-08 20:17:18','2017-12-08 20:17:18','tip/default.jpeg',69,91,'45.5016018','-73.6019897'),(38,'Sweets and Icecream','Go to Cones and Candy at Westhill for old fashioned sweets and homemade icecream.','http://www.cones-candy.co.uk',2,'2017-12-08 20:53:20','2017-12-14 23:21:35','2017-12-14 23:21:35','tip/default.jpeg',197,14,'57.1431362','-2.1095842'),(39,'Lovely walk down the beach','I enjoy long walks down the beach. Was even able to catch a nice sunset. Splendid',NULL,2,'2017-12-11 16:59:25','2017-12-11 17:15:11','2017-12-11 17:15:11','tip/default.jpeg',105,14,'57.1488353','-2.1007694'),(40,'School Closed for Snow','Use this link to find out if your school in Aberdeenshire is closed because of snow.','https://online.aberdeenshire.gov.uk/Apps/Schools-Closures/default.aspx',2,'2017-12-11 21:42:59','2017-12-11 21:42:59',NULL,'tip/1513028577.jpg',69,25,'40.7265994','-73.9909083'),(41,'Easy train journey','If you are a group of people (5 people) you can get a group ticket which is cheaper.',NULL,2,'2017-12-12 09:04:57','2018-02-18 08:48:37',NULL,'tip/1513069496.jpg',152,84,'14.58503','120.9786494'),(42,'Balgove Farm Shop','Great selection of local produce, craft beer and craft gin, deli, butcher, ice cream and gifts. There is also a steak house and cafe.','https://www.balgove.com',2,'2017-12-12 23:42:27','2017-12-12 23:42:27',NULL,'tip/default.jpeg',207,23,'56.344872','-2.8138717'),(43,'Beautiful handbags','Get gorgeous handbags from Stella on Chapel Street','https://m.facebook.com/StellarShopAberdeen/?locale2=en_GB',2,'2017-12-13 12:42:51','2017-12-13 12:42:51',NULL,'tip/default.jpeg',69,14,'57.2812368','-2.3753531'),(44,'Ask nicely','If you ask nicely you can get potatoes with your baked potatoes. That\'s like DOUBLE potatoes!!',NULL,2,'2017-12-14 20:45:00','2017-12-14 23:23:42','2017-12-14 23:23:42','tip/default.jpeg',210,98,'40.7671802','-73.9614301'),(45,'Not a basement','For all you new to basements, this is not a basement',NULL,2,'2017-12-14 20:57:22','2017-12-14 23:21:51','2017-12-14 23:21:51','tip/default.jpeg',210,100,'57.1462815','-2.1067513'),(46,'Was better bacl when.. .','It wasn\'t blown up',NULL,2,'2017-12-14 21:18:54','2017-12-14 23:21:01','2017-12-14 23:21:01','tip/default.jpeg',205,92,'40.7473604','-74.011485'),(47,'Can be a bit unstable','One those rebels start a rocking, get a going.',NULL,2,'2017-12-14 21:23:07','2017-12-14 23:23:30','2017-12-14 23:23:30','tip/default.jpeg',210,106,'55.9413071','-3.1940609'),(48,'Better than cheadle','That Cheadle 2 is better than Cheadle',NULL,2,'2017-12-14 21:26:20','2017-12-14 23:23:15','2017-12-1