/default.jpeg',212,117,'40.7649729','-73.9680726'),(60,'Need to get this','Best thing I have ever bought. Didn\'t know I was about to blow but glad I was covered','http://www.volcanoinsurance.com',3,'2017-12-14 22:34:14','2017-12-14 23:22:03','2017-12-14 23:22:03','tip/default.jpeg',205,116,'40.7625502','-73.9760167'),(61,'The Siege','sieeeeeeeewgeeeeee',NULL,3,'2017-12-14 23:04:24','2017-12-14 23:21:15','2017-12-14 23:21:15','tip/default.jpeg',214,119,'55.9545126','-3.2145066'),(62,'Meanwhile','Meanwhile at the legion of doom.',NULL,3,'2017-12-14 23:37:32','2017-12-15 10:14:23','2017-12-15 10:14:23','tip/default.jpeg',217,120,'40.7290195','-73.9893026'),(63,'Great Electrician','Raymond really helped us with sockets and phone extension. \nClean, tidy, punctual, excellent job.','http://bniscotlandnorth.com/scotland-north-(aberdeen-and-the-highlands)-aberdeenshire-(inverurie)/memberdetails.php?memberId=1667705&t=79bd089122ffee5f5515fe41e7fc39f400fdd50ba3b6cb681d763fd6a6d8307d&name=Raymond+Henderson',3,'2017-12-15 13:21:18','2017-12-15 13:21:18',NULL,'tip/1513344077.jpg',129,14,'57.3353731','-2.3226038'),(64,'Best Turkish Food in London','Nomura Bos Cirrik in Stoke Newington','http://www.cirrik.co.uk',3,'2017-12-17 14:51:59','2017-12-17 14:51:59',NULL,'tip/1513522319.jpg',76,32,'57.4029651','-2.222591'),(65,'Aberdeenshire Council Winter Treatment Plan','During the winter months, Aberdeenshire Council have a Winter Operations Room that allows them to receive and process information from various sources on a 24-hour basis and react accordingly','https://www.aberdeenshire.gov.uk/roads-and-travel/roads/maintenance/winter-maintenance/#gritting',3,'2017-12-17 16:25:20','2017-12-17 16:25:20',NULL,'tip/default.jpeg',209,93,'57.1533713','-2.2792366'),(66,'Countdown to Christmas','With 6 days to go until Santa pays us all a visit. Let\'s relax with some festive games, courtesy of Google','https://santatracker.google.com/intl/en/village.html',3,'2017-12-17 16:35:05','2017-12-17 16:35:05',NULL,'tip/1513528504.24767072851652',209,14,'57.159341','-2.1137684'),(67,'Great bar on the Canal near Angel and Old Street','The Commisary has great outside seating on a pontoon on Regents Canal.','http://www.thecommissary.net/',3,'2017-12-17 17:09:09','2017-12-17 17:09:09',NULL,'tip/1513530548.jpg',76,32,'57.0479582','3.0409024'),(68,'Best cakes and paninis for miles','The Birdhouse Cafe in Banchory is run by husband and wife team Any and Cameron. Amazing handmade cakes (including gluten free) and delicious paninis. Their special balsamic sauce for the breakfast rolls is also a treat!','https://www.facebook.com/birdhousecafe/',3,'2017-12-18 14:51:03','2017-12-18 14:51:03',NULL,'tip/1513608663.jpg',225,25,'51.5340657,','-0.0948488'),(69,'Amazing seafood restaurant','If you happen to find yourself in Edinburgh and like seafood, then Ondine is amazing. Book in advance and it is 1 per oyster during December during oyster happy hour','https://www.ondinerestaurant.co.uk',3,'2017-12-18 21:25:24','2017-12-18 21:25:24',NULL,'tip/1513632324.jpg',230,21,'57.1439645','-2.1139783'),(70,'Down the Hatch Cafe Bistro','Amazing food here! Located at Port Edgar Marina under the Forth Road Bridge. They do great Canadian food and Milkshakes. \n\nI would recommend the Pulled Pork Poutine - Fries, melted cheese, gravy and pulled pork!',NULL,3,'2017-12-20 13:55:47','2017-12-20 13:55:47',NULL,'tip/1513778147.jpg',131,21,'57.0535222','-2.9355582'),(71,'Website Design & Build','If youre looking for a company to build your website who are reliable, knowledgeable and affordable then choose LFI Creative from Westhill, Aberdeenshire','http://www.lficreative.com',3,'2017-12-21 17:57:52','2017-12-21 17:57:52',NULL,'tip/1513879071.jpg',71,14,'57.1382927','-2.1243468'),(72,'Great Butcher','Go to the butcher H.M Sheridans in Ballater for the best sausages, venison and lots of great local produce.','http://www.hmsheridan.co.uk',3,'2017-12-23 18:05:06','2017-12-23 18:05:06',NULL,'tip/1514052306.jpg',69,92,'57.2029436','-2.4627319'),(73,'Visiting the Louvre Abu Dhabi','If you love art you must visit this museum. Although it doesnt have as many art pieces as the Louvre in Paris, the master pieces that are showcased are just fantastic. Also the super modern architecture in itself and the surrounding water and gardens  are well worth seeing. If you can, try going during the week and avoid weekends (Friday and Saturday). Prices at the coffee shop are very reasonable and museum shop has some great art books for both adults and children.','https://www.louvreabudhabi.ae/en/visit/plan-your-visit',3,'2017-12-23 21:00:03','2017-12-23 21:00:03',NULL,'tip/1514062801.jpg',147,39,'57.2787189','-2.3736665'),(74,'Crimbo','Merry Crimbo!!\n\nCraaaiiiggg Daaavid',NULL,3,'2017-12-24 10:28:43','2017-12-24 12:16:44','2017-12-24 12:16:44','tip/default.jpeg',242,122,'57.4792579','4.2282897'),(75,'Test Tip','Testing Testing 123',NULL,4,'2017-12-24 11:41:21','2017-12-24 12:15:41','2017-12-24 12:15:41','tip/default.jpeg',243,27,'38.7354677','9.1477835'),(76,'Excellent afternoon tea','If you are looking for afternoon tea in pleasant friendly surroundings , go to the Auld Kirk in Ballater .. can always add prosecco for those special days ..','http://www.theauldkirk.com',4,'2017-12-24 17:21:06','2017-12-24 17:21:06',NULL,'tip/default.jpeg',227,92,'45.4847428','9.2050598'),(77,'Best handyman ever.','He fixed it for me to milk a cow blindfolded.',NULL,4,'2017-12-25 16:14:41','2017-12-25 18:29:59','2017-12-25 18:29:59','tip/default.jpeg',246,14,'47.5575776','10.7476117'),(78,'Top childcare','Try the overnight service.',NULL,4,'2017-12-25 16:20:08','2017-12-25 18:29:43','2017-12-25 18:29:43','tip/default.jpeg',246,14,'40.7035132','-73.9939204'),(79,'Chinese eatery','Very good food and nice decorated restaurant situated in Hells Kitchen',NULL,4,'2017-12-25 20:41:11','2017-12-25 20:41:11',NULL,'tip/default.jpeg',188,30,'55.9926681','-3.4101937'),(80,'Romantic Scottish Castles','If youre lo