INSERT INTO `reviews` VALUES (30,'Lots of things to do with kids, very family friendly city.',5,69,21,'2017-11-25 01:07:26','2017-11-25 01:07:26','Great city for families'),(31,'Lovely little town with everything you need. Nice walks along the beach and good range of shops and cafes.',5,69,23,'2017-11-25 01:13:04','2017-11-25 01:13:04','Relaxed seaside town'),(32,'As a family of four with young children we relocated to Abu Dhabi in 2014. Our first international assignment!! And what an amazing 3 years we had in the Middle East. Weve just recently moved to Hannover, Germany.  I know lots of local information about Abu Dhabi and will be happy to share with anyone that is thinking of moving there.',5,122,39,'2017-12-01 13:27:49','2017-12-01 13:27:49','Going to be an expat in Abu Dhabi??'),(40,'If you are looking for a special afternoon tea look up the The Auld Kirk for that something different . 31 Braemar Road Ballater 01339755762',5,227,92,'2017-12-24 10:23:50','2017-12-24 10:23:50','Afternoon Tea Ballater'),(41,'Best gluten free bakery I have had the pleasure of finding.  Croissants are to die for',5,469,96,'2018-06-12 13:30:41','2018-06-12 13:30:41','Boulangerie le Marquis');
