INSERT INTO `pages` VALUES (2,1,'feel like a local','ANYWHERE','<h1 style=\"text-align: center;\">how it works</h1>\r\n<div class=\"hiw col-xs-12 col-sm-10 col-sm-offset-1\">\r\n<div style=\"text-align: center;\">\r\n<div class=\"col-xs-12 col-sm-4\">\r\n<h4 style=\"text-align: left;\"><span class=\"text-grey\">NEIGHBOURHOOD SEARCH</span></h4>\r\n<p style=\"text-align: left;\"><span style=\"font-family: avenir-lt-w01_35-light1475496, sans-serif; font-size: 16px; text-align: center;\">Find your ideal neighbourhood by matching your preferences and get tips and advice from locals, so your new city feels like home sooner.</span></p>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-4\" style=\"text-align: left;\">\r\n<h4><span class=\"text-grey\">FIND THE THINGS YOU LOVE&nbsp;</span></h4>\r\n<p><span style=\"font-family: avenir-lt-w01_35-light1475496, sans-serif; font-size: 16px; text-align: center;\">Get matched to local businesses, events&nbsp;and&nbsp;activities you\'ll love. Create&nbsp;personalised guidebooks to your city and keep&nbsp;everything organised.</span></p>\r\n<p><strong>SHARE AND CONNECT</strong></p>\r\n</div>\r\n</div>\r\n<div class=\"margin-top-sm\">\r\n<div class=\"col-xs-12 col-sm-4\" style=\"text-align: left;\">\r\n<p>Share your tips and guidebooks to help others. Find friends, share messages and ask advice about your new city without having to reveal your&nbsp;Facebook account.&nbsp;</p>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-4 last-item\">&nbsp;</div>\r\n</div>\r\n</div>','home','your local guide to your city','moving, relocation, local, moving home, local tips, moving guide','ACTIVE','2017-08-14 13:30:23','2017-09-13 23:25:27','<h3 style=\"text-align: center;\">FIND YOUR<br />FAVOURITES</h3>\r\n<p style=\"text-align: center;\">Local businesses you look<br />interested in, can offer<br />vouchers so you can try<br />them out when you arrive.</p>','<h1 style=\"text-align: center;\"><em>what is RelocateGuru?</em></h1>\r\n<p style=\"text-align: center;\"><span style=\"background-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 26px; font-family: futura-lt-w01-light, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\">RelocateGuru is a new global social network to find, share and organise everything&nbsp;you need to know about&nbsp;</span></span><span style=\"background-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: georgia, palatino, \'book antiqua\', \'palatino linotype\', serif; font-size: 26px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; font-family: futura-lt-w01-light, sans-serif; background-position: initial initial; background-repeat: initial initial;\">your town in one place</span></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #2a2a2a; font-family: futura-lt-w01-light, sans-serif; font-size: 16px; letter-spacing: 1.600000023841858px; text-align: start;\">I wished it wasn\'t so hard to feel at home when moving to a new place, and it wasn\'t just me finding it difficult. My friends would tell me their struggles and the headache it was trying to get settled in their new cities. From organising the logistics; from schools, houses and all the practical things, to&nbsp;finding friends and finding all the little things we take for granted and miss from&nbsp;home. And despite searching hundreds of websites, blogs and forum groups there was so much that I still didn\'t know until a neighbour told me months later something that would\'ve been handy earlier.</span></p>','<h3 style=\"text-align: center;\">COMPARE YOUR<br />NEIGHBOURHOOD</h3>\r\n<p style=\"text-align: center;\">Rate and review your local area.</p>\r\n<p style=\"text-align: center;\">See how your postcode compares to other areas.</p>\r\n<p style=\"text-align: center;\">Share tips and shout out about your favourite local businesses, so others can find the best place to live.</p>'),(3,1,'feel like a local before you move',NULL,'<h1 style=\"text-align: center;\">What is RelocateGuru?</h1>\r\n<p style=\"text-align: center;\">RELOCATEGURU is a social media platform created to help you find all the information you need for your move and allow you to organise it, all in one place.</p>\r\n<p style=\"text-align: center;\">We want to help you FEEL LIKE A LOCAL BEFORE YOU MOVE.</p>\r\n<p style=\"text-align: center;\">It will be a place where locals can share all the best bits about where they live, so you can find the stuff we wished we knew about BEFORE we moved!</p>\r\n<p style=\"text-align: center;\">Through sharing our knowledge and insider tips, like the best websites, the most useful Facebook groups and our favourite local businesses, we can help each other feel more at home quicker.</p>','personal',NULL,NULL,'ACTIVE','2017-08-15 07:55:50','2017-09-13 23:09:36','<h3 style=\"text-align: center;\">START ENJOYING YOUR NEW HOME</h3>\r\n<p class=\"margin-top\" style=\"text-align: center;\">We want to take away the stress and worry about moving anywhere in the world.</p>\r\n<p style=\"text-align: center;\">By helping to make your new home feel more familiar before you get there, you can get settled quicker, find all your new favourites.</p>','<h1 style=\"text-align: center;\">Find Connections</h1>\r\n<p style=\"text-align: center;\">Connect with locals, through matches such as \"friends of friends\" on Facebook so you can ask questions (without having to share your Facebook profiles!) about your new neighbourhood and get a real feel for the neighbourhood you are moving to and maybe find a new friend!</p>','<h3 class=\"margin-top\" style=\"text-align: center;\">DISCOVER LOCAL BUSINESSES</h3>\r\n<p style=\"text-align: center;\">When searching for all your new favourites based on local reviews and ratings, relevant local businesses from coffee shops to estate agents, nurseries to gym clubs, can offer vouchers so you can try them out when you arrive.</p>'),(4,1,'Attract more dream customers',NULL,'<h1 style=\"text-align: center;\">Why Join RelocateGuru?</h1>\r\n<h3 class=\"text-grey\" style=\"text-align: center;\">GET MORE CUSTOMERS, SPEND LESS TIME AND MONEY ON ADVERTS</h3>\r\n<p style=\"text-align: center;\">RelocateGuru is a new social network for locals. A place where you can find all the things you wished you knew about in your neighbourhood. Including where to find all the BEST businesses like yours!</p>\r\n<p style=\"text-align: center;\">We believe that your business should be ranked based on how GREAT you are at what you do. Not by who pays the most on adverts and sponsored listings or posts something every 5 mins!</p>\r\n<p style=\"text-align: center;\">If you have our FREE Starter Package, you get the same opportunity to be listed at the top as if you are on the Ultimate Package. It depends on how your customers rate you. It is more important to us that the best businesses get seen by your dream clients. You can also increase your credibility and gain points the more you help others by sharing your tips and advice.&rdquo;</p>\r\n<p style=\"text-align: center;\">Instead, on packages of Pro or above, you get the opportunity to offer reward vouchers to attract more new customers and reward your loyal customers. You will also get bonus features designed to help boost your business.</p>','business',NULL,NULL,'ACTIVE','2017-08-15 08:39:17','2017-08-21 10:46:59',NULL,'<h1 style=\"text-align: center;\">Special Offer for Founding Members</h1>\r\n<h3 class=\"text-grey\" style=\"text-align: center;\">SIGN UP NOW FOR LIMITED OFFER!</h3>\r\n<p style=\"text-align: center;\">If you join us before RelocateGuru launches you will receive <strong>3 Months</strong> of the Ultimate Membership for <strong>FREE!</strong> This is limited to the first 300 businesses that sign up. If you invite other businesses to join, you get an extra month of Ultimate Membership for every <strong>10 businesses</strong> that you join because of you.</p>',NULL),(5,1,'Privacy Policy',NULL,'<h1>Our Privacy Policy</h1>\r\n<p>This is something about our privacy policy</p>','privacy-policy',NULL,NULL,'ACTIVE','2017-08-21 10:11:08','2017-08-21 10:37:08',NULL,NULL,NULL),(6,1,'Terms & Conditions',NULL,'<h1><strong>Our Terms &amp; Conditions</strong></h1>\r\n<p>Something about our Terms &amp; Conditions</p>','terms-and-conditions','terms and conditions','','ACTIVE','2017-08-21 10:45:07','2017-08-25 08:00:21','<p>test111</p>','<p>test2</p>','<p>test3</p>');
